const Header = () =>{
    return(
        <header>
            <h3>
                <a href="/main" onClick={(event)=>{
                        event.preventDefault(); 
                    }
                }>WEB</a>
            </h3>
        </header>
    );
}

const Nav = ({title})=>{
    const topicList = title.map((topic)=>
        <li>
            <a href="#">{topic.title}</a>
        </li>
    );
    return(
       <ul>
        {topicList} 
        {console.log(topicList)}
       </ul>
    );   
}

export {Header, Nav};
